import React from "react";

function Card(props){

  React.useEffect(() => {
    dispatch(getBreeds());
  }, [dispatch]);
  const items = props.tems.map(e => {
    return <li>{e.name}</li>
  })
  return (
    <div>
      <ul>
        {items}
      </ul>
      <button onClick={props.prev}>prev</button>
      <button onClick={props.next}>next</button>
    </div>
  )
}
export default Card;
